contracts/TokenOwnership.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ERC200 is ReentrancyGuard, Ownable {
    string public name = "Sacred Token";
    string public symbol = "SCT";
    uint8 public decimals = 18;
    uint256 public totalSupply;
    uint256 public tokenPrice;
    mapping(address => uint256) public balanceOf;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event TokensPurchased(address indexed buyer, uint256 amount, uint256 cost);

    constructor(uint256 _supply, uint256 _price) Ownable(msg.sender) {
        require(_supply > 0, "Total supply must be greater than zero");
        require(_price > 0, "Token price must be greater than zero");

        totalSupply = _supply * (10 ** uint256(decimals));
        tokenPrice = _price;
        balanceOf[msg.sender] = totalSupply;
    }

    function buyTokens(uint256 _amount) external payable nonReentrant {
        uint256 cost = _amount * tokenPrice;
        require(_amount > 0, "Must buy at least one token");
        require(msg.value == cost, "Incorrect ETH amount sent");
        require(balanceOf[owner()] >= _amount, "Not enough tokens available");

        balanceOf[owner()] -= _amount;
        balanceOf[msg.sender] += _amount;

        (bool success, ) = payable(owner()).call{value: msg.value}("");
        require(success, "Transfer to owner failed");

        emit TokensPurchased(msg.sender, _amount, cost);
        emit Transfer(owner(), msg.sender, _amount);
    }

    function withdrawFunds() external onlyOwner nonReentrant {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Withdraw failed");
    }
}

